import React, {Component} from "react";
import {Card} from "react-bootstrap";

import '../tabata.css'

class Excercice extends Component {
    render() {
        return(
            <div>
                <Card>
                    <Card.Body>
                        <Card.Title>Vueltas:</Card.Title>
                        <Card.Subtitle className="mb-2 text-muted">Tiempo de descanso:</Card.Subtitle>
                    </Card.Body>
                </Card>
            </div>
        );
    }
}

export default Excercice;
